import React from "react";
import {Link} from "react-router-dom";
import "../index.css"

const Home = () =>{
    return(
<div className="   ptest d-flex flex-row justify-content-center align-items-center">
    <div className=" text-center   ">
        <h1 className="" >Welcome message</h1>
        <Link to="/login">
        <button type="button" className="  mx-4 btn btn-primary">log in</button>
        </Link>
        <Link to="/register">
        <button type="button" className=" mx-4 btn btn-primary">Register</button>
        </Link>
    </div>
</div>
    )}

export default Home
